import React from 'react';
import ContactForm from './contactForm';

class Contact extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            name: '',
            email: '',
            message: '',
            buttonText: 'Submit'
        };
    }

    render() {
        return (
            <div className="container">
                <h1>Contact</h1>
                <div className="form-container">
                    <ContactForm/>
                </div>
            </div>
        );
    }
}

export default Contact;
